var myApp=angular.module("hello",["ui.router"]);myApp.config(function(b){var a=[{name:"hello",url:"/hello",component:"hello"},{name:"about",url:"/about",component:"about"},{name:"people",url:"/people",component:"people",resolve:{people:function(c){return c.getAllPeople()}}},{name:"people.person",url:"/{personId}",component:"person",resolve:{person:function(d,c){return d.find(function(e){return e.id===c.personId})}}}];a.forEach(function(c){b.state(c)})});myApp.run(function(b,a){window["ui-router-visualizer"].visualizer(a);b.get("data/people.json",{cache:true})});